import React, { Component } from "react";
import { BASE_URL } from "../config";
import axios from "axios";
import MainMenu from "../Components/Header/MainMenu";
import { Card, Image, Button } from "semantic-ui-react";

export default class confirmed extends Component {
  //   static async getInitialProps() {
  //     let confirms = [];
  //     try {
  //       const response = await axios.get(`${BASE_URL}/confirmed`);
  //       confirms = response.data;
  //       console.table(confirms);
  //     } catch (error) {
  //       console.log(error);
  //     }
  //     return { confirms };
  //   }
  //   componentDidMount() {
  //     console.log("Yay");
  //   }

  //   renderConfirmed(confirms) {
  //     return confirms.map((key) => {
  //       //  console.log(confirms);
  //       return confirms;
  //     });
  //   }
  render() {
    const { confirms } = this.props;
    return (
      <div className="main">
        <MainMenu />
        {/* {confirms} */}
        <Card.Group >
          <Card>
            <Card.Content>
              <Image
                floated="right"
                size="mini"
                src="https://react.semantic-ui.com/images/avatar/large/steve.jpg"
              />
              <Card.Header>Steve Sanders</Card.Header>
              <Card.Meta>Friends of Elliot</Card.Meta>
              <Card.Description>
                Steve wants to add you to the group{" "}
                <strong>best friends</strong>
              </Card.Description>
            </Card.Content>
            <Card.Content extra>
              <div className="ui two buttons">
                <Button basic color="green">
                  Approve
                </Button>
                <Button basic color="red">
                  Decline
                </Button>
              </div>
            </Card.Content>
          </Card>
          <Card>
            <Card.Content>
              <Image
                floated="right"
                size="mini"
                src="https://react.semantic-ui.com/images/avatar/large/molly.png"
              />
              <Card.Header>Molly Thomas</Card.Header>
              <Card.Meta>New User</Card.Meta>
              <Card.Description>
                Molly wants to add you to the group <strong>musicians</strong>
              </Card.Description>
            </Card.Content>
            <Card.Content extra>
              <div className="ui two buttons">
                <Button basic color="green">
                  Approve
                </Button>
                <Button basic color="red">
                  Decline
                </Button>
              </div>
            </Card.Content>
          </Card>
          <Card>
            <Card.Content>
              <Image
                floated="right"
                size="mini"
                src="https://react.semantic-ui.com/images/avatar/large/jenny.jpg"
              />
              <Card.Header>Jenny Lawrence</Card.Header>
              <Card.Meta>New User</Card.Meta>
              <Card.Description>
                Jenny requested permission to view your contact details
              </Card.Description>
            </Card.Content>
            <Card.Content extra>
              <div className="ui two buttons">
                <Button basic color="green">
                  Approve
                </Button>
                <Button basic color="red">
                  Decline
                </Button>
              </div>
            </Card.Content>
          </Card>
        </Card.Group>
      </div>
    );
  }
}
